- input: TEXT,F3XA,,"This submission responds to the Commission's letter of February
    16th.  1)    The contribution was for $5,000.  The report has been amended.     2)
    The report has been amended to include federal payroll on Line 30b.  3)   Payments
    to Groundswell communication were for voter id activity and payment to Ourso Beycheck
    was for a generic absentee ballot mailing.  Neither expenditure is allocable to
    any federal candidate.  4) Payments for life and health insurance and payroll
    on Line 21a were for employees who did not work more than 25% of their time in
    connection with federal elections  5)    The expenditure on H4 noted as direct
    mail was actually a poll and was not shared or allocable to any federal candidate  6)  Expenditures
    for survey and voter file maintenance are not for activities that meet the definition
    of federal election activity."
